INSERT INTO `qstn_question` (`question_id`, `question_number`, `question_name`, `form_id`, `category_id`, `question_group_id`) VALUES
(31, '1', 'หัวหน้าหน่วยงานของท่านจะกล่าวชื่นชม (says a good word) เมื่อเห็นว่ามีการปฏิบัติงานตามแนวทางความปลอดภัย สำหรับผู้ป่วย หรือผู้รับบริการที่กำหนดไว้', 5, 1, 3),
(32, '2', 'หัวหน้าหน่วยงานของท่านจะพิจารณาข้อเสนอแนะของเจ้าหน้าที่เพื่อปรับปรุงความปลอดภัยสำหรับผู้ป่วยหรือผู้รับบริการอย่างจริงจัง', 5, 1, 3),
(34, '3', 'เมื่อไรก็ตามที่มีภาวะกดดัน เร่งด่วน  หัวหน้าหน่วยงานจะขอให้เราทำงานด้วยความรวดเร็วระมัดระวัง   แม้อาจมีการทำงานที่ลดขั้นตอน (shortcut) แต่ต้องไม่ส่งผลให้มีความเสี่ยงเพิ่มขึ้น', 5, 1, 3),
(38, '4', 'หัวหน้าหน่วยงานของท่านใส่ใจกับปัญหาความปลอดภัยของผู้ป่วยหรือผู้รับบริการที่เกิดขึ้น เพื่อป้องกันไม่ให้เกิดขึ้นซ้ำแล้วซ้ำอีก', 5, 1, 3),
(39, '1', 'การกำหนดทิศทางการทำงานขององค์กรมีความชัดเจนและครอบคลุมเรื่องวิสัยทัศน์ ค่านิยม เป้าประสงค์ และผลการดำเนินงานที่สำคัญที่ได้คาดหวัง', 6, 2, 4),
(40, '2', 'วิสัยทัศน์มีความชัดเจนและนำไปปฏิบัติได้', 6, 2, 4),
(41, '3', 'ค่านิยมองค์กรมีความชัดเจนและสามารถปฏิบัติตามได้ถูกต้อง', 6, 2, 4),
(42, '4', 'การกำหนดทิศทางขององค์กรมีความเกี่ยวข้องหรือให้ความสำคัญกับผู้รับบริการและผู้มีส่วนได้ส่วนเสียขององค์กร ', 6, 2, 4),
(43, '5', 'มีการกำกับ ติดตาม และประเมินผลการการปฏิบัติตามแผนการดำเนินงานที่กำหนดไว้', 6, 2, 4),
(44, '6', 'ผู้บริหารเป็นแบบอย่างที่ดีในการดำเนินการตามวิสัยทัศน์ที่กำหนดไว้		', 6, 2, 4),
(45, '7', 'ผู้บริหารเป็นแบบอย่างที่ดีในการดำเนินการตามค่านิยมที่กำหนด ', 6, 2, 4),
(46, '8', 'ผู้บริหารมีการสื่อสาร อธิบาย หรือชี้แจงให้ทราบถึงแผนการดำเนินงานงานและหรือตัวชี้วัดความสำเร็จของหน่วยงาน', 6, 2, 4),
(47, '9', 'ผู้บริหารมีกลยุทธ์หรือแนวทางที่จะดำเนินการให้สำเร็จตามเป้าหมายที่วางไว้', 6, 2, 4),
(48, '1', 'การชี้แจงวิสัยทัศน์ พันธกิจ และเป้าหมายขององค์กรให้บุคลากรทุกระดับได้ทราบอย่างชัดเจน ', 6, 2, 5),
(49, '2', 'มีการสร้างความร่วมมือกับบุคลากรทุกระดับเพื่อให้การดำเนินงานเป็นไปตามเป้าหมายที่วางไว้', 6, 2, 5),
(50, '3', 'มีการเปิดโอกาสให้บุคลากรทุกระดับได้สื่อสารโต้ตอบแบบ 2 ทิศทาง เพื่อสร้างความเข้าใจที่ถูกต้อง ตรงกัน', 6, 2, 5),
