(193, '6', 'พยาบาลได้ให้ข้อมูลเกี่ยวกับสิทธิการรักษาพยาบาลของผู้รับบริการอย่างเพียงพอและครอบคลุม', 12, 13, 35),
(194, '1', 'พยาบาลรู้สึกมั่นใจคุณภาพการพยาบาลที่ให้แก่ผู้รับบริการ', 12, 13, 36),
(195, '2', 'พยาบาลชี้แจงภาวะของโรคและอาการที่เกิดแก่ผู้รับบริการจนผู้รับบริการเข้าใจได้ดี', 12, 13, 36),
(196, '3', 'การให้บริการของพยาบาลคำนึงถึงความปลอดภัยประสิทธิภาพและถูกต้องรวดเร็ว', 12, 13, 36),
(197, '4', 'พยาบาลได้จัดเตรียมเครื่องมือทางการแพทย์ที่มีประสิทธิภาพและพร้อมใช้ในการให้บริการแก่ผู้รับบริการ', 12, 13, 36),
(198, '5', 'พยาบาลได้ปรับปรุงและพัฒนาการพยาบาลใหม่ๆที่เป็นประโยชน์และนำมาใช้กับผู้รับบริการ', 12, 13, 36),
(199, '6', 'พยาบาลได้จัดทำเอกสารเผยแพร่ความรู้ทางสุขภาพและการพยาบาลที่ทันสมัย และเป็นประโยชน์ต่อผู้รับบริการและครอบครัว', 12, 13, 36),
(200, '1', 'พยาบาลปฏิบัติการพยาบาลโดยคำนึงถึงคุณภาพชีวิตและความต้องการของผู้รับบริการเป็นสำคัญ', 12, 13, 37),
(201, '2', 'พยาบาล ได้ชี้แจงข้อมูลเกี่ยวกับภาวะโรคของผู้รับบริการให้รับทราบเป็นระยะๆ', 12, 13, 37),
(202, '3', 'พยาบาลได้เฝ้าระวังและป้องกันภาวะเสี่ยงที่จะเกิดอันตรายต่อผู้รับบริการ', 12, 13, 37),
(203, '4', 'พยาบาลให้การป้องกันอันตรายและช่วยเหลือผู้รับบริการทันทีที่ผู้รับบริการเริ่มมีปัญหา', 12, 13, 37),
(204, '5', 'พยาบาลระมัดระวังมิให้ผู้รับบริการได้รับความเจ็บปวดหรืออันตรายต่างๆขณะรับการรักษา', 12, 13, 37),
(205, '36', 'พยาบาลปฏิบัติงานโดยยึดถือตามมาตรฐานวิชาชีพ', 12, 13, 38),
(206, '37', 'พยาบาลร่วมมือกันพัฒนาวิชาชีพให้เจริญก้าวหน้าในสังคมอย่างเป็นเอกภาพ			', 12, 13, 38),
(207, '38', 'พยาบาลร่วมมือกับผู้อื่นในกิจกรรมที่เป็นประโยชน์ต่อสังคม', 12, 13, 38),
(208, '39', 'พยาบาลให้ความร่วมมือกับกิจกรรมที่เป็นประโยชน์ต่อสังคม ทั้งในระดับท้องถิ่น ระดับประเทศและระหว่างประเทศ', 12, 13, 38),
(209, '1', 'พยาบาลให้ความร่วมมือในการพัฒนาวิชาชีพการพยาบาลโดยการเข้าร่วมกิจกรรมขององค์กรวิชาชีพ', 12, 13, 39),
(210, '2', 'พยาบาลนำผลงานวิจัยหรือหลักฐานทางวิชาการมาใช้ปรับปรุงการปฏิบัติการพยาบาล', 12, 13, 39),
(211, '3', 'พยาบาลกระตือรือร้นในการมีส่วนร่วมกำหนดนโยบายและแผนพัฒนาวิชาชีพการพยาบาล', 12, 13, 39),
(212, '4', 'พยาบาลมีการพัฒนาตนเองในการศึกษาหาความรู้เพิ่มเติมโดยการศึกษาต่อเนื่องและฝึกอบรม', 12, 13, 39),
(213, '5', 'พยาบาลรับผิดชอบในการพัฒนาความรู้และศาสตร์ทางการพยาบาลเพื่อการพัฒนาวิชาชีพ', 12, 13, 39),
(214, '6', 'พยาบาลมีความพยายามในการสร้างองค์ความรู้ทางการพยาบาลและเผยแพร่สู่เพื่อนร่วมวิชาชีพ', 12, 13, 39),
(215, '7', 'พยาบาลส่งเสริมและเผยแพร่ความรู้ด้านการดูแลสุขภาพสู่ประชาชน ทั้งในระดับบุคคล ครอบครัวและชุมชน', 12, 13, 39),
(216, '1', 'พยาบาลให้บริการแก่ผู้รับบริการ ตามกฎระเบียบอย่างเหมาะสม', 12, 13, 40),
(217, '2', 'พยาบาลมีความชำนาญและคล่องแคล่วว่องไวในการปฏิบัติงาน', 12, 13, 40),
(218, '3', 'พยาบาลปฏิบัติงานน่าเชื่อถือ และเป็นมิตรพอที่ผู้รับบริการจะเปิดเผยความลับได้', 12, 13, 40),
(219, '4', 'พยาบาลได้ประสานกับทีมสุขภาพเป็นอย่างดีเพื่อผลการรักษาของผู้รับบริการ', 12, 13, 40),
(220, '5', 'พยาบาลทำงานอย่างเต็มความรู้ความสามารถ', 12, 13, 40),
