(353, '1. อยากให้องค์กรแสดง career path ที่ชัดเจนในสายงาน \r\n2. อยากให้องค์กรมีการประเมินผลงานตาม achievement / target นอกเหนือจากการประเมินปกติที่นำชั่วโมงทำงานมาเป็นส่วนหนึ่งในการพิจารณา  (ตั้ง target ไว้เพื่อให้บุคลากรตั้งใจและพัฒนางาน เนื่องจากความสำเร็จ 1 ชิ้นงานแต่ละคนใช้เวลาไม่เท่ากัน คนที่ทำงานช้ากลับได้เปรียบเพราะเบิกค่า OT ได้มากกว่าคนที่ทำงานเสร็จเร็ว ซึ่งเป็นเรื่องที่ไม่สมควร) \r\n3. อยากให้องค์กรให้คุณค่าและกระตุ้นการสร้างวัฒนธรรมความกระตือรือร้นในการทำงาน ลดบทบาทและลดทอนอำนาจการทำงานแบบเช้าชามเย็นชาม เปิดโอกาสให้บุคคลากรที่มีความรู้ความสามารถได้แสดงศักยภาพ และส่งเสริมบุคลากรที่มีความพร้อมพัฒนาและทำงาน\r\n4. อยากให้ในหน่วยงานย่อย มีผู้เชี่ยวชาญ มีประสบการณ์อย่างแท้จริง เป็นที่ปรึกษา เป็น role models ในสายงานนั้นๆ สร้างหลักการ ความเข้าใจที่ถูกต้อง และสามารถให้ข้อมูลประสานงานระหว่างหน่วยงานได้อย่างมีเหตุผล ชัดเจน ไม่คลุมเครือ เพื่อการดำเนินงานอย่างราบรื่นและถูกต้อง เพราะการนำมีความสำคัญ ถ้าผู้นำไม่มีความรู้ ความเชี่ยวชาญทั้งเฉพาะด้านและรอบด้านแล้ว จะไม่มีความน่าเชื่อถือของหน่วยงาน\r\n5. อยากให้องค์กรให้คุณค่าที่ผลงานและพนักงานที่มีผลงานดี แทนการให้คุณค่าตามอายุงาน เปิดโอกาสและยอมรับการให้ตำแหน่งการจัดการและบริหารงานแก่บุคคลากรรุ่นใหม่ที่มีศักยภาพ', 1, 6, '59007'),
(354, 'หัวหน้าบางหน่วยงาน ยังไม่สามารถที่จะควบคุม ดูแลบุคลากรที่รับผิดชอบได้ ขาดการตัดสิน ให้คำแนะนำ ตักเตือน ที่ชัดเจน ทำให้บุคลากรภายใต้การดูแลไม่ปฏิบัติตาม ', 1, 6, '56017'),
